import React, { useEffect, useState, useRef } from 'react';
import io from 'socket.io-client';

const LiveTrackingMap = ({ request, user }) => {
  const [driverLocation, setDriverLocation] = useState(null);
  const [lastUpdate, setLastUpdate] = useState(null);
  const [socket, setSocket] = useState(null);
  const [estimatedTime, setEstimatedTime] = useState(15);
  const mapRef = useRef(null);
  const [map, setMap] = useState(null);
  const [driverMarker, setDriverMarker] = useState(null);

  useEffect(() => {
    const newSocket = io('http://localhost:5000');
    setSocket(newSocket);
    newSocket.emit('join-room', request._id);

    newSocket.on('driver-location-update', (data) => {
      if (data.requestId === request._id) {
        console.log('üìç Received driver location:', data.location);
        setDriverLocation(data.location);
        setLastUpdate(new Date(data.timestamp));

        // Create map if it doesn't exist
        if (!map && window.google && mapRef.current) {
          initMap(data.location);
        } else if (map) {
          updateDriverMarker(data.location);
        }
      }
    });

    return () => newSocket.disconnect();
  }, [request._id, map]);

  const initMap = (driverLoc) => {
    if (!window.google || !mapRef.current) return;

    console.log('üó∫Ô∏è Creating map...');
    const mapInstance = new window.google.maps.Map(mapRef.current, {
      zoom: 16,
      center: { lat: driverLoc.latitude, lng: driverLoc.longitude }
    });

    setMap(mapInstance);

    // Create driver marker immediately
    const marker = new window.google.maps.Marker({
      position: { lat: driverLoc.latitude, lng: driverLoc.longitude },
      map: mapInstance,
      title: 'Driver Location',
      animation: window.google.maps.Animation.BOUNCE
    });

    setDriverMarker(marker);
    console.log('‚úÖ Map and driver marker created!');
  };

  const updateDriverMarker = (location) => {
    if (!map || !driverMarker) return;

    console.log('üöó Moving driver to:', location.latitude, location.longitude);
    driverMarker.setPosition({ lat: location.latitude, lng: location.longitude });
    map.panTo({ lat: location.latitude, lng: location.longitude });
  };

  const calculateDistance = (lat1, lon1, lat2, lon2) => {
    const R = 6371;
    const dLat = (lat2 - lat1) * Math.PI / 180;
    const dLon = (lon2 - lon1) * Math.PI / 180;
    const a = Math.sin(dLat/2) * Math.sin(dLat/2) +
      Math.cos(lat1 * Math.PI / 180) * Math.cos(lat2 * Math.PI / 180) *
      Math.sin(dLon/2) * Math.sin(dLon/2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
    return R * c;
  };

  return (
    <div style={{ margin: '15px 0' }}>
      <div style={{ position: 'relative' }}>
        <div 
          ref={mapRef}
          style={{
            width: '100%',
            height: '300px',
            borderRadius: '15px',
            border: '2px solid #e0e0e0',
            overflow: 'hidden',
            backgroundColor: '#f0f0f0'
          }}
        />

        <div style={{
          position: 'absolute',
          top: '15px',
          left: '15px',
          background: 'rgba(0,0,0,0.8)',
          color: 'white',
          padding: '10px',
          borderRadius: '8px',
          fontSize: '14px',
          fontWeight: 'bold',
          zIndex: 1000
        }}>
          üöó Driver coming to you - ETA: {Math.ceil(estimatedTime)}min
        </div>

        {driverLocation ? (
          <div style={{
            position: 'absolute',
            bottom: '15px',
            left: '15px',
            right: '15px',
            background: 'rgba(76,175,80,0.9)',
            color: 'white',
            padding: '10px',
            borderRadius: '8px',
            textAlign: 'center',
            fontSize: '12px',
            zIndex: 1000
          }}>
            ‚úÖ Driver Live Location Active
            <br />Last Update: {lastUpdate?.toLocaleTimeString()}
          </div>
        ) : (
          <div style={{
            position: 'absolute',
            bottom: '15px',
            left: '15px',
            right: '15px',
            background: 'rgba(255,152,0,0.9)',
            color: 'white',
            padding: '10px',
            borderRadius: '8px',
            textAlign: 'center',
            fontSize: '12px',
            zIndex: 1000
          }}>
            ‚è≥ Waiting for driver location...
          </div>
        )}
      </div>
    </div>
  );
};

export default LiveTrackingMap;
